import React from 'react'


function Header(){
    const title = "Design is my life.";

    return (
        <div className='navbar bg-primary'>
        <h2 className='text-white m-3'>{title}</h2>
        <h1 className='text-white'>{5*6}</h1>
      </div>
    );
}

export default Header
